import React , {Component} from 'react';
import {Button } from 'reactstrap';
import {BrowserRouter, NavLink} from 'react-router-dom';
class App extends Component {
  render(){
    return (
     <div >Home page

         <Button color="danger" size='lg'>HELLO TO HOME PAGE</Button>
         <Button color="success" size='lg'><NavLink></NavLink></Button>
     </div>
      
    );
  }
 
}

export default App;
